DROP TABLE IF EXISTS `notification_list`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `notification_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `user_notif_id` int(11) NOT NULL,
  `user_notif_username` varchar(64) NOT NULL,
  `project_title` varchar(128) DEFAULT NULL,
  `project_id` int(11) DEFAULT NULL,
  `type_notif` varchar(64) NOT NULL,
  `date_of_view` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `n_read` tinyint(1) DEFAULT '0',
  `user_followed_id` int(11) DEFAULT NULL,
  `user_followed_name` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_notif_nfu` (`user_id`),
  KEY `fk_notif_project_id` (`project_id`),
  KEY `fk_notif_user_notif_id` (`user_notif_id`),
  KEY `fk_notif_user_followed_id` (`user_followed_id`),
  CONSTRAINT `fk_notif_project_id` FOREIGN KEY (`project_id`) REFERENCES `projects` (`id`) ON DELETE CASCADE,
  CONSTRAINT `fk_notif_user_followed_id` FOREIGN KEY (`user_followed_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `fk_notif_user_notif_id` FOREIGN KEY (`user_notif_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `ft_notif_nfu` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1948 DEFAULT CHARSET=latin1;
