INSERT INTO `project_openings` VALUES (1,1,'Teammate','Programming','I did all the branding and design of the website but i need to find someone to help me with the code. Sneaker fanatic would be a big plus.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457647970/khzrojhuriq03qe71tk3.jpg','2016-03-10 22:14:03','[\"Javascript\",\"Angular.js\"]'),(2,4,'Mentor','Venture Financing','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457649671/kizncswdexdoqkryxfc6.jpg','2016-03-10 22:42:39','0'),(3,7,'Tips','Programming','We\'re looking to build an online store. Any help would be welcome. :)','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457692081/ujuqfw65cec0k8odp6ty.jpg','2016-03-11 10:29:46','[\"Drupal\",\"WordPress\"]'),(4,8,'Teammate','SEO','SEO is salvation','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457693183/rhveuan66zb5w8c5oise.jpg','2016-03-11 10:47:41','0'),(8,16,'Tips','Business Analysis','Data is really something I have trouble reading. Help would be great','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457703851/bprq0jjf48ivxpufobsr.jpg','2016-03-11 13:43:53','0'),(9,16,'Teammate','Product Design','The goal is to design a table with the same spirit. If interested, ping me !','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457703851/bprq0jjf48ivxpufobsr.jpg','2016-03-11 13:44:36','0'),(10,21,'Teammate','Javascript','bonjour','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457969236/k4fstru1o2chdkla4jf3.jpg','2016-03-14 16:41:16','0'),(14,29,'Teammate','Product Design','','','2016-04-24 06:44:11','[\"Branding\",\"Graphic Design\"]'),(21,55,'Any help','Product Design','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458586835/i85k7hlipk0wq373ptv2.jpg','2016-03-21 18:59:10','0'),(23,56,'Any help','Product Design','Really keen to get feedback and ideas from real users on how the Build Focus alpha works for them, and changes and tweaks that would help them avoid distraction even better.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458647973/z5iv8etb5ngy6ripuin3.jpg','2016-03-22 12:04:13','0'),(24,56,'Any help','SEO','Build Focus comes up well for searches for its name, but not so much for other related keywords, and it\'s a crowded space. I\'d love some ideas from people with skills in improving that.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458647973/z5iv8etb5ngy6ripuin3.jpg','2016-03-22 12:05:11','0'),(25,56,'Any help','Graphic Design','I\'m not a graphic designer. Build Focus has a lot of art involved, and while I think it\'s reasonably good, it\'s not *great*; I\'d love just thoughts and direction in what I should be working on.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458647973/z5iv8etb5ngy6ripuin3.jpg','2016-03-22 12:05:56','0'),(26,57,'Mentor','Business Angels','I have created and driven two projects to niche markets already, and am seeking a more experienced mentor who could help me realize my goal of getting this gadget into the mass market.','','2016-04-24 06:44:50','[\"Venture Capital\",\"Business Development\",\"Product Management\"]'),(27,59,'Mentor','Advertising Strategy','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458838787/ahudgcyrlyaboomjokzi.jpg','2016-03-25 14:04:31','[\"Communication\"]'),(28,59,'Any help','Marketing Strategy','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458838787/ahudgcyrlyaboomjokzi.jpg','2016-03-25 14:10:28','0'),(33,7,'Mentor','Product Design','Test need','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457692081/ujuqfw65cec0k8odp6ty.jpg','2016-04-18 13:32:16','[\"Javascript\",\"Adobe Photoshop\"]');
