INSERT INTO `projects` VALUES (1,2,16,'Sneakerdot','Shop and collect sneakers from a number of stores','New York','','NY','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457647970/khzrojhuriq03qe71tk3.jpg','<h1></h1>\n\n<h1>Coming Spring 2016</h1>\n\n\n\n<hr>\n\n\n\n<p><strong>Sneakerdot</strong> is a marketplace where users can shop and collect sneakers from numerous stores including Mr Porter, Matchesfashion and End Clothing, while also having the latest news and sneaker release dates.</p>\n\n<hr>\n\n<p><br></p>\n\n<p><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457648173/rq4wh8evex5ijdfkkwsj.jpg\" data-image=\"\" style=\"text-align: center; font-family: Arial, \'Helvetica Neue\', Helvetica, Tahoma, sans-serif; font-size: 15px; line-height: 24px;\"></p>','Beta project',NULL,140,34474,'Sara Peterson','','Technology','0px -302px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457647970/ke4znwli5yz2gz5v721p.jpg',1,NULL),(3,4,4,'Delepaule Bags','Delepaule is the urban bag which allow you to not choose.','Berlin','','Germany','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649267/zb6t1hh9thpkphslp8xi.jpg','<p><u><strong>DELEPAULE</strong></u><br>&nbsp;<br><strong>Delepaule</strong>&nbsp;is a whole range summed up in a single product! Get it and choose later how you are gonna use it, according to your mood, your schedule, your lifestyle. This is an ambitious project, based on local economy and short cycle, but with a global scale. If a country distributes&nbsp;<strong>Delepaule,</strong>&nbsp;it means that the bag is manufactured in the country. The identity of&nbsp;<strong>Delepaule</strong>&nbsp;will be built on the divergence of techniques and cultures. It is based on the valorization of these cultures through details and finishes made, always with the single watchword: quality at any trial for a bag that can follow you anywhere!<br>&nbsp;<br>&nbsp;</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653424/fiqfg3mteogsieunwagl.jpg\" data-image=\"\"></figure>\n\n<p><em><br>&nbsp;<br>It all started with the frustration of having to choose.<br>&nbsp;<br>The brand philosophy, the identity, the policy made a brand unique. It is easy to federate to an idea, but much more complicated to seize it. Indeed, each brand offers a whole range of products in which the consumer has to choose.<br>&nbsp;<br><strong>Delepaule</strong>&nbsp;is based on : An idea, a philosophy, a product.<em><br>&nbsp;<br>&nbsp;<br>Delepaule is not just a bag, is also a new idea of business model. Based on the short distribution channel values (local, social, well-made,&nbsp;environmentally responsible) and the global distribution of standard channel, Delepaule wants to create a huge stylist network who will create and&nbsp;distribute the bag on their own country. Each product&nbsp;will be slightly different, and it will be for the best ;D<br>&nbsp;<br>&nbsp;<br><em></em></em></em></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653443/jdnnmbem5uuj3qbvnplj.jpg\" data-image=\"\"></figure>\n\n<p><em><em><em><br>&nbsp;<strong>Delepaule</strong>&nbsp;offers you the right not to choose. You like the idea? Agree with it by adopting the product, and choose later how you will like to wear it.<strong>Delepaule</strong>&nbsp;gives you the possibilities of a whole range in a single product. Assemble & disassemble it as ease as a construction game!<em><br>&nbsp;<br>The&nbsp;<strong>Delepaule</strong>&nbsp;is composed of three parts : The main bag, which as two large pockets (vertical & horizontal) able to welcome a 15\" laptop. The small bag, which is able to carry a 10\" tablet. And two straps that you can assemble as you want, to create the most suitable bag for you and your needs : backpack (2 or 3 pockets), messenger, shoulder bag or tablet bag.<br>&nbsp;<br>The idea came up in Barthélémy Delespaul street, in Lille. M. Delespaul was a industrial specialized in linen spinning (start of 19th century). The name :<strong>Delepaule</strong>&nbsp;is a tribute to the history & the culture of my region, mixed up with a bit of humor : le sac de l\'épaule (the bag on a shoulder).<br>&nbsp;<br><em></em></em></em></em></em></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653457/xeyoulve0dpws2uonhhj.jpg\" data-image=\"\"></figure>\n\n<p><em><em><em><em><em><br>&nbsp;<br>&nbsp;The fabrication of the bag respect a strict policy : the highlight of the different actors of the project. The bag is made by a stylist using fabrics from Europe. The distribution is in the same country that the manufacture. In that way, materials and technics used can be different from one country to another, adding value to the bag thanks to a local knowhow.&nbsp;<br>&nbsp;</em></em></em></em></em></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653548/bs3axauo6kdwixsa9er6.jpg\" data-image=\"\"></figure>\n\n<p><em><em><em><em><em><br><em>The bag is unique but declinations are multiples. Before using it as you wish, you will be able to find it in several versions, giving you a feeling of uniqueness.<br></em></em></em></em></em></em></p>\n\n<ul><li><em><em><em><em><em><em><em><em><em>&nbsp;version available in 3 color combinaisons. (night, brick, mustard)</em></em></em></em></em></em></em></em></em></li><li><em><em><em><em><em><em></em></em></em></em></em></em><em><em><em><em><em><em>version created by the stylist every seasons.</em></em></em></em></em></em></li><li><em><em><em><em><em><em></em></em></em></em></em></em><em><em><em><em><em><em>limited edition in collaboration with artists, the bag becomes a expression area.</em></em></em></em></em></em></li></ul>\n\n','Beta project',NULL,67,40502,'Jeanne Coleman','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649179/tp4f4nre7dci6xlsvz2l.jpg','Fashion','0px -335px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649267/ygtny2dvmdvqtrsixkyr.jpg',1,NULL),(4,5,16,'Pine64','PINE A64 is the world\'s first 64-bit expandable Quad Core 1.2Ghz supercomputer, starting at just $15','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649671/kizncswdexdoqkryxfc6.jpg','<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/3CKO9kWLxS4\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div>\n\n<p><br></p>\n\n\n\n<p>PINE A64 is not only a computer, it is a super affordable 64-bit high performance expandable single board computer (SBC). &nbsp;Whether you are an IT professional, electronics hobbyist, student, teacher, hacker, inventor, or just someone who wants to have more flexibility to increase their productivity at work, the PINE A64 is a computer board made for everyone. &nbsp;Enjoy more fun and entertainment at home with endless possibilities.<br></p>\n\n<h1></h1>\n\n<h1>PINE A64 is Small</h1>\n\n<p>The PINE64 CPU is a quad-core ARM A53 64-bit processor that runs at 1.2GHz.&nbsp;</p>\n\n\n\n<p>The GPU on the PINE A64 is a dual-core MALI-400 MP2 and runs at 500MHz, capable of 1.1 Gpixel/s throughput. This means the graphics capabilities are slightly higher than the original X-Box\'s level of performance. &nbsp;</p>\n\n\n\n<p>PINE A64 board is powered by the latest 64-bit quad core ARM A53 CPU and delivers up to 20-30% better performance than other 32 bit open source counterparts.</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653903/s5jmcwgfadglhzshunps.jpg\" data-image=\"\"></figure>\n\n<h1></h1>\n\n<h1>PINE64 is Expandable</h1>\n\n<p>Add different hardware interfaces to your PINE A64 as you see fit. Depending on whether you pick the PINE A64 or PINE A64+, the PINE A64 ships defaults with two USB ports, HDMI output, 3.5mm Audio/Mic Output, ethernet port, and two I/O expansion buses. On the more advanced PINE A64+ model, you will receive three additional ports to add optional accessories such as: camera module, touch panel module, and the LCD Panel port.</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653975/t4v4ihrcvx6p9qmslhcf.jpg\" data-image=\"\"></figure>\n\n<p><br></p>\n\n<p>PINE A64 is Versatile<br></p>\n\n<p>Add a keyboard and mice and turn PINE A64 into a full Android 5.1 computer to run Chrome Browser, Microsoft Word, Excel, Powerpoint, or even watch your favorite shows on YouTube.<br></p>\n\n<p>Load special versions of Android 5.1 and launch media players to turn this into an advanced Apple TV-like Android product. &nbsp;<em>PINE A64 supports miracast.</em><br></p>\n\n<p>Install a touchscreen module and choose from hundreds of thousands of games from the Android store to build your own arcade.&nbsp;<br>Play your favorite games on the big screen!</p>\n\n<p>Build a custom enclosure to use the PINE64 in your next innovative project.</p>\n\n<p>Because PINE A64 is an open source platform, you can load anything you want but we suggest to pair PINE A64 with Ubuntu, Android or openHAB IoT. By aligning the PINE A64 to be compatible with these operating systems, you basically get access to over 1.7 Million apps* on the market today, from utilities, games, and media apps.&nbsp;<br></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458654106/lafheonrevmp0fgmihhz.jpg\" data-image=\"\"></figure><p><br></p>\n\n<p><br></p>','Beta project',NULL,122,46397,'Igor Gourevitch','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649484/hlr71vj7alebi8xgrnso.jpg','Technology','0px -231px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649671/icpk2iq7b164kywr7x2z.jpg',1,NULL),(5,10,16,'Shammane Smartwatch','Technology meets elegance in the timeless watch you\'ll be proud to wear.','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457690537/zissgz99kqs4ci4mm83n.jpg','<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/G7Tfn33ofOo\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div>\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691019/tdbjr49rtkjb7imrpned.jpg\" data-image=\"\"></figure>\n\n\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691031/wizcwlvn3yaw4yogkceq.jpg\" data-image=\"\"></figure>\n\n\n\n<h1>Shammane understands that people require more out of their wristwatch then just telling time.&nbsp;</h1>\n\n\n\n<p>The Shammane Smartwatch is an elegant, timeless wearable that helps you stay connected to the people, places, and events you care about most, without sacrificing style.</p>\n\n\n\n<p>Our watch is a discreet way to stay connected to the people and things not immediately in front of you, without distracting you from the ones who are.</p>\n\n\n\n<p>3 Sets available&nbsp;<br>Each set is composed of :<br>- The smartwatch core (display)<br>- 2 straps made of different colors, textures and/or materials.</p>\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691203/tkghdhuwwx4cqufsjejm.jpg\" data-image=\"\"></figure>\n\n<p><br></p>\n\n<h1>The watch in a few words</h1><p>A smartwatch is at the edge of jewelry and technology, is not a smartphone nor a computer. Its emotional dimension is much stronger, it is an object in contact with our own skin. We design our watch so it adapts to our lifestyles and wardrobes. We made it user-friendly, beautiful, pure and elegant.<br>The Shammane smartwatch case is made from polished rose gold-plated aluminium that looks great with any outfit .&nbsp;</p><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691225/rttsrybk9aq9gvfmjh8z.jpg\" data-image=\"\"></figure>\n\n<p>Your writs are tiny? The diameter of 39mm and the size of our straps (18mm) make our watch designed for any size of wrists.&nbsp;<br></p><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691236/xdjgcmhbc1wjyqi9urwe.jpg\" data-image=\"\"></figure>\n\n<h1>Functions : how smart is the watch ?</h1><p>Life is complicated. Your watch shouldn’t be.&nbsp;</p>\n\n<p>The SHAMMANE Smartwatch sit comfortably at the intersection between daily life and the digital world.</p>\n\n<p>We’ve kept it simple - focusing on the essential features of a smartwatch:&nbsp;&nbsp;you will be able to see a number of different notifications, like texts, calendar reminders, incoming calls and instant messages from applications installed on your smartphone.</p>\n\n<p>For the healthy part, the watch has a pedometer to track your steps and efforts.</p><h1>Phone Notifications</h1><p>Thanks to a Bluetooth 4.0 technology, the watch alerts you (sound alert or vibration) when you receive a notification. It can be a call, a text message or a Facebook Messenger. You also have the ability to display all the notifications from your phone. Messages are displayed on our 1.22-inch LCD touch screen display (240x240 pixel resolution).<br></p><p>Customize which alert have to be pushed from your smartphone using our dedicated APP (available on Google Play and Apple app store).</p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458654640/emuh4lzpsenonjmihy8b.jpg\" data-image=\"\"></figure><p><br></p><h1>SWAP TO SEE MESSAGES & ALERTS</h1><p>Messages, alerts, calendar notifications will be pushed to your smartwatch : scroll through the notifications to see them.&nbsp;</p>\n\n<p>Our current UI (User Interface) is pure and simple so you can read clearly your messages without being distracted by anything else.</p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458654724/biecndchwtafnnvdcark.jpg\" data-image=\"\"></figure><p><br></p><h1>Specifications</h1><p>Shammane will filter out only the most important of notifications. You choose what is a worthy distraction and filter the continuous stream of incoming, to just what you want to hear about.</p>\n\n<p><strong class=\"redactor-inline-converted\">A LONGER BATTERY LIFE</strong></p>\n\n<p>Unlike most of current touch screen smartwatches, the SHAMMANE does not need to be charged daily, you can use it up to 3 days (in normal use).&nbsp;</p>\n\n<p>The watch has a simple architecture : it allows use to extend the battery life.</p>\n\n<p><strong>WATER PROTECTION</strong></p>\n\n<p>The SHAMMANE Smartwatch is IP67. It means the watch is protected when you wash your hands or if you get caught in a heavy rain storm. It does not mean the watch is 100% waterproof : you should take it off when swimming or having a shower.</p><p><br></p>','Beta project',NULL,72,39787,'Erwan Colins','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457689509/pxwhhrsrg8y3t9qnmutl.jpg','Technology','0px -68px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457690537/iew8hgd02i0srsacgxwy.jpg',0,NULL),(6,11,16,'Modular Smartwatch','Choose the modules you want to build a smartwatch unique to you.','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457690636/strpo46szso36quglhtr.jpg','<h1>Engineering Prototype:</h1><p>BLOCKS is the world’s first modular smartwatch. Compared to our phones, smartwatches are small and have limited space inside. This means that other smartwatch companies are having to compromise on which features they to put into a tiny little device that fits around your wrist. We wanted to give that power back to you, the user, to choose what features are important just for you.</p>\n\n<p>BLOCKS breaks away from compromise with a unique design. Start simply with the watchface, also known as the Core, which is a fully functioning smartwatch on its own, then add Modules into the strap to enhance functionality of your watch. You can choose ANY Modules you want and connect them together to build a smartwatch unique to you.</p><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457690952/l3tjbnchkctvyql5oves.jpg\" data-image=\"\"></figure><h1>Elegant Interface</h1>\n\n<p>We’ve designed the user experience to be as intuitive and simple as possible. Notifications, activity tracking, and the additional features of all your Modules are available at the flick of a finger. These are preliminary designs are subject to change.</p><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691070/tih82sjqpebtwrupmkmr.png\" data-image=\"\"></figure><p>Operating System</p>\n\n<p>BLOCKS\' operating system is based on the latest version of Android and is running on a powerful and efficient Qualcomm processor. With the help of Qualcomm and our other software partners, we have optimized our Android OS for power consumption.&nbsp;</p>\n\n<p>We are using Android, which like BLOCKS, is an open-platform. With Android it is easy to develop apps and to implement our modular framework. A lot of developers already have apps on androids, and they only need to optimize their apps to work on the watch.</p>','Live project',NULL,23,67638,'Serge Didenko','','Technology','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457690636/y5pru3xbqadzkxxlqcoh.jpg',1,NULL),(7,12,2,'Brace Leather','Beautiful leather accessories for life on the go','Chicago','','IL','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692081/ujuqfw65cec0k8odp6ty.jpg','<h1>Brace makes your life easier.&nbsp;</h1>\n\n<p><strong>Brace Leather</strong>&nbsp;is dedicated to design that is minimal, simple, and beautiful. Our goods are designed and crafted by experienced artisans with long-lasting and beautiful materials. Man Overboard is our first collection, a set of essential leather accessories for cafe life or work on the go.&nbsp;Our beautifully designed leather accessories are the essentials you need for life’s everyday adventures.&nbsp;</p>\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692324/ywpvi9xu4zp5y6l9hwag.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<h1>We need your help</h1>\n\n\n\n\n\n<p>We are very excited to introduce to you the Man Overboard kit: the essentials for life on the go. Our goal was simple: to use the inherent beauty of leather to create a beautiful set that will be functional, simple and last a lifetime. We are making the whole kit available on Kickstarter for purchase, along with each piece sold separately.</p>\n\n\n\n\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692271/k1w5xcftw0qd8fejkuoy.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n<h1>Our Leather</h1>\n\n\n\n\n\n<p>We only work with full grain leather which is the highest quality leather available on the market. Full-grain leather refers to hides that have not been sanded, buffed, or snuffed to remove imperfections or natural marks on the surface of the hide. This means each of our pieces will be naturally unique. Rather than wearing out, it will develop a patina over time. Our leather will wear beautifully and it will actually look better as it ages!</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692296/emegpfalbancuutw6pp1.jpg\" data-image=\"\"></p>\n\n\n\n\n\n<p>This beauty will take your laptop and your favourite magazine/ipad/notebook out on an adventure.<br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458655151/lyxpz6o8ktoxxvz3wqxd.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><br></p>','Idea','',88,28914,'Sebastian Moresta','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691617/vefkdhglnraxr2owpfji.jpg','Craft','0px -247px','h4dj0hxldvj2mjrm6yyk','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692087/sdmxm6vfsz8cj5rpo5mi.jpg',1,NULL),(8,13,8,'Ho Karan','Artisans bretons de soins bio pour hommes','Nantes','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693183/rhveuan66zb5w8c5oise.jpg','<p>Nous sommes des Bretons, passionnés des bons produits, de notre région, et de la cosmétique.</p>\n\n<p>Nous avons créé HO KARAN, \"je vous aime\" en Breton, pour offrir des soins biologiques aux hommes, à tous ceux qui comme nous aiment les produits bons, biens et beaux et qui aimeraient trouver dans leur salle de bain des soins respectueux de ces valeurs.&nbsp;</p>\n\n\n\n<p>Aujourd’hui on se tourne vers vous car nous avons besoin de votre aide pour faire vivre ce projet qui nous anime. Le moindre euro compte et nous fera plaisir. Pour les plus généreux ce sera l’occasion de recevoir nos soins issus de l\'agro-ressource bio bretonne en avant-première.</p>\n\n<hr>\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457695811/m1jte0ifnuo2it24tdpc.jpg\" data-image=\"\"></figure><h1>1/ DES PRODUITS BONS</h1>\n\n\n\n<p>Les soins HO KARAN ont été formulés sur le principe d\'une alliance terre & mer avec des ingrédients biologiques d\'exception isssus de l\'agro-ressource bretonne.</p><p>Des végétaux et matières premières biologiques cultivés en respectant le rythme de la nature et récoltés de manière responsable.</p>\n\n\n\n<p>Nous avons développé l\'identité olfactive des soins avec un nez, comme un véritable parfum de parfumeur. Il s\'agit d\'une composition de 50 huiles essentielles aux notes chyprées et généreuses, pour offrir aux hommes des soins bio et raffinés.</p><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457695878/cn9jawtdrn40irm2ausj.jpg\" data-image=\"\"></figure><p><br></p><p><br></p>','Live project',NULL,17,83403,'Laure Adung','','Green','0px -343px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693183/hvwjhlru2wlaszpkfpue.jpg',1,NULL),(9,14,7,'Secret Hitler','A social deduction game for 5-10 players about finding and stopping the Secret Hitler.','Montreal','','QC','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693488/lomxex9ss2yzjw1dsxbu.jpg','<h2>What is Secret Hitler ?</h2>\n\n<hr>\n\n\n\n\n\n<p>Secret Hitler is a dramatic game of political intrigue and betrayal set in 1930\'s Germany. Players are secretly divided into two teams - liberals and fascists. Known only to each other, the fascists coordinate to sow distrust and install their cold-blooded leader. The liberals must find and stop the Secret Hitler before it’s too late.<br></p>\n\n\n\n\n\n<p>Each round, players elect a President and a Chancellor who will work together to enact a law from a random deck. If the government passes a fascist law, players must try to figure out if they were betrayed or simply unlucky. Secret Hitler also features government powers that come into play as fascism advances. The fascists will use those powers to create chaos unless liberals can pull the nation back from the brink of war.</p>\n\n\n\n<p><br></p>\n\n\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693688/el7ny7wm7unmzlgtgo8y.jpg\" data-image=\"\"></figure>\n\n\n\n<p><br></p>\n\n<h1>How do you play ?</h1>\n\n<p>In Secret Hitler, each player is randomly assigned to be a liberal or a fascist, and one player is Secret Hitler. The fascists know in advance who Hitler is, but Hitler doesn\'t know who his fellow fascists are, and the liberals don\'t know who anyone is. Since the liberal team always has a majority, the fascists must play like moles, gaining the trust of the liberals to sabotage their plans and make them suspicious of each other.</p>\n\n\n\n<p>The objective of the liberal team is to pass 5 liberal policies or assassinate Secret Hitler. The objective of the fascist team is to pass 6 fascist policies or elect Secret Hitler chancellor after 3 fascist policies have passed.</p>\n\n\n\n<p>Each round, the President selects a Chancellor. The whole table votes \"Ja!\" or \"Nein!\" on their ticket; if a majority of players vote “Ja!,” the elected President and Chancellor take the following actions to pass a new policy:</p>\n\n\n\n<p>The President draws 3 policies from a random deck.<br>The President discards 1 policy and passes 2 to the Chancellor.<br>The Chancellor discards 1 policy and enacts the final one as law.<br>If a fascist policy passes, the President gains a new power that she must use immediately.&nbsp;</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458655577/qklmfj1k4mklzmoct8x9.jpg\" data-image=\"\"></figure><h1>What is so special ?</h1><p>Secret Hitler is a love letter to hidden identity games like Werewolf/Mafia, The Resistance, and Avalon, but it\'s also a new design that fixes some of our biggest problems with those games.</p>\n\n<p>No moderator: Secret Hitler doesn\'t require a moderator - everyone can join in the game.<br>No early player elimination: We love the suspense of player elimination, but Secret Hitler saves that drama for the very end&mdash;assassinated players will rarely have to wait more than ten minutes before the game ends.</p><p>In games like Werewolf, you can only act on your gut feeling. Secret Hitler creates a much more heady experience - there\'s almost enough information that you can solve the game like a puzzle, but not quite enough. Players always have enough information to make meaningful choices, but we\'ve simplified the decisions to avoid analysis paralysis; each round the President nominates a Chancellor, and the table votes yes or no to that ticket.</p><p><b>Why is Secret Hitler set in 1933 Germany?</b>&nbsp;</p><p>We believe that the theme and setting of a game work best when they help explain the story and mechanics.<br></p><p>Hitler’s takeover was, for a dictator, surprisingly political: he wasn’t a general who subverted a popular revolution, he wasn’t backed by foreign interests, there wasn’t a total collapse of government he took advantage of. He used the rickety systems of the Weimar Republic to gain power mostly legally; he was handed the Chancellorship by men who thought they could \"control\" him.</p>\n\n<p>Hitler and his allies spent years manipulating the levers of democracy, accumulating power in a snowball effect. He divided and intimidated his rivals. He used national crises to strengthen his own position. His followers were organized and brutal, and his rise was equally engineered and opportunistic. There were good men who didn\'t understand how dangerous he was until it was too late, and there were bad men who wanted power for themselves but were outmaneuvered.</p>\n\n<p>Social Deduction games are about a well-coordinated minority trying to convince a confused majority to vote against its interests. It\'s an inherently political genre.</p>\n\n<p>We set out to make a game to help us reflect on the ways that others - good, bad, indifferent - were complicit in Hitler\'s rise to power. Our game doesn\'t model the specifics of German parliamentary politics. Instead, we try to model the paranoia and distrust he exploited, the opportunism that his rivals failed to account for, and the disastrous temptation to solve systemic problems by giving more power to the \"right people.\"</p>','Idea',NULL,20,11285,'Max Tolkin','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Games','0px -163px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693488/kdlzyuywfdkombfkg7uo.jpg',1,NULL),(10,15,14,'Pixelio 3D','First Portable All-in-One & Easy-to-Use 3D Scanner','Shanghai','','China','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694415/dbqd6scilxpna4r26144.jpg','<h1>What is Pixelio 3D ?</h1><p>Using the latest 3D technology Smart 3D Ltd has created Pixelio. Pixelio is an innovative, modern and easy to use 3D scanner that can be used by everyone!</p><p>Until now, the market has lacked a good and low cost device for 3D printer users that allowsto copy objects, make spare parts, or archive collections in the form of 3D files.</p><p>Smart 3D Ltd team createsa device that fill this gap. The company also wanted to add some simpleand clever features to theirsmall devices. That is why&nbsp;Pixelio&nbsp;– the first baby of Smart 3D became also a device that helps to improve your photos or even movies. &nbsp;</p><p>Pixelio will introduce you to a new dimension in 3D photography.<br>With Pixelio scanner you can enjoy high-tech features for a reasonable price. All you need is a smartphone or gopro camera.</p><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694556/w5aydr3esev57ast5kss.png\" data-image=\"\"></figure><p><br></p><h1>Who is Pixelio 3D for ?</h1><p>Everyone will find Pixelio useful!</p>\n\n<p>Affordable and user-friendly it should satisfy the most demanding photographers and 3D printer users. Pixelio does not have its own optics as for that purpose, it uses your smartphone camera and a free app (eg. 123D Catch). That makes it even more accessible.</p>\n\n<p>Featuring a wide range of functionality Pixelio will be perfect for:</p><ol><li>sellers on eBay, &nbsp;other auction sites</li><li>bloggers and vloggers</li><li>graphics</li><li><span></span>real estate developers</li><li><span></span>architects, engineers etc.&nbsp;</li><li><span></span>or even tourists who want to take the best panoramic pictures.</li></ol><p>Pixelio is a simple and fast way to create amazing 360 degree photos! This option will particularly appeal to you if you sell on the Internet, write a blog or deal with professional product photography. The process of creating pictures is automatic. 360 degree photos can be saved to MP4 or GIF format.</p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1457694539/wgi7ix2t2zhwedhaxvxh.mp4',54,30536,'Hu Tang','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694177/nsei9eggjayb8ifodvdq.jpg','Science','0px -207px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694415/tyvw4l3ieuahlye7enjb.jpg',1,NULL),(11,17,16,'Codeplace','Netflix for Developers','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457695577/c1xiv9kb4jyqazoq0b4g.jpg','<p><strong>Codeplace</strong>&nbsp;reverse engineers real applications and transforms them into standardised step by step guides. Understand what to code and why.</p>\n\n<p>Learn how to build anything ranging from Marketplaces to Social Networks.</p>\n\n\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457695751/dls80pussxmyjmqgniqo.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><br></p><h1>HOW THE SERVICE WORKS</h1><p>We are an online education platform providing courses, tutorials and mentoring to teach Users how to program web applications. We provide content (video lectures, audio clips, text, code, scripts, software and photographs) to help Users develop web applications using multiple software tools and technologies. See the How it works section of the Website for more information.<br></p><hr><p>-More details coming soon-<br></p>','Idea',NULL,98,64656,'Jan Casoli','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457695005/q8is5nltripbe00azwqj.jpg','Art','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457695577/xsmiow0zc3bdhux9p4bb.jpg',1,NULL),(12,19,2,'Nod | Real-life messaging','','Denver','','CO','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457697040/smgmr5qzrcfquplsxkil.jpg','<h1><strong>nod is a real-life messaging service</strong></h1>\n\n<p>I love technology but in an age where so much of our communication is digital and received on screens, I wanted to create a service which would enable people to send something real, with a message, super easily and for a great price, just as part of everyday life.</p>\n\n\n\n<figure><em>###figcaption<the family=\"\">/figcaption###</the></em></figure><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457697276/i60wwnbcy4asjyxd3w3i.jpg\" data-image=\"\"></figure>\n\n\n\n<p><em></em></p>\n\n<p><em></em></p><em>\n\n<h1>There’s three products</h1>\n\n\n\n<figure><em><figcaption>Twig</figcaption></em></figure>\n\n\n\n<p><em></em></p>\n\n<p><em></em></p><em>\n\n<figure><em><figcaption>Bottle</figcaption></em></figure>\n\n\n\n<p><em></em></p>\n\n<p><em></em></p><em>\n\n<figure><em><figcaption>Flag</figcaption></em></figure>\n\n\n\n<p><em><br>Each with any message you like, beautifully packaged and sent to anyone you wish, with postage included for&nbsp;<strong>£2</strong>,&nbsp;<strong>£2.50</strong>&nbsp;and&nbsp;<strong>£3</strong>.<br>I was initially looking to send twigs in an envelope with a little message, as pure novelty - a bit of a joke. But as I played around with the idea in my head it grew into something bigger and I started to imagine a set of products that would actually be nice to receive.<br>Theres also a label inside if you want to write an accompanying message or sign it with your name.</em></p>\n\n<p><em></em></p><em>\n\n<figure><em><figcaption>Twig packaging</figcaption></em></figure>\n\n\n\n<p><em><br>Keeping costs minimal, I scoured the internet for tools and materials that stayed in budget, whilst not compromising on the aesthetics or quality.<br>I started designing the packaging, developing the products as I went along and after weeks of deliberation, I settled on a name, whipped up some logos and nod was born.</em></p>\n\n<p><em></em></p><em>\n\n<figure><em><figcaption>Bottle packaging</figcaption></em></figure>\n\n\n\n<p><em><br>I’m now working on a sleek website, that works on all platforms so you can send a nod in a few clicks, where-ever, whenever.<br>I’m really pleased with how far it’s come and with your support, I’ll be able to purchase the materials and tools I need to bring this to life.</em></p>\n\n<p><em></em></p><em>\n\n<figure><em><figcaption>Flag packaging</figcaption></em></figure>\n\n\n\n<p><em><br>I believe receiving a nod could make someone’s day, or at least brighten it, give them a laugh, a cry, or just give them that fantastic, child-like, feeling in their chest as they rip the sticker and band off and open it up to see what’s inside.<br>Whether it’s for an occasion or celebration, an apology, sympathy, a thank you, a joke, to let someone know you’re thinking of them or to remind them of something, ask them something, give advice or just an inspiring or funny quote.<br><strong>I want nods to be sent for anything and everything.</strong><br>Any message you like, to anyone you wish. Great design, value and experience. That’s nod. Thank you.<br>-------------------------------------------------------------------</em></p>\n\n<p><em></em></p><em>\n\n<h1>Thanks for coming this far...</h1>\n\n\n\n<p><em><em><em>By pledging towards nod, you won\'t only be receiving your nods before anyone else but you\'ll be setting the foundations of the business and determining it\'s future, supporting me and my journey, which is something I\'ll never forget! At the end of the campaign, if successful, I\'m going to print out every backers name and use them to fill a big glass bottle which will be sealed and mounted in a box frame which will live in my workshop.<br></em></em></em></p>\n\n</em></em></em></em></em></em></em>','Idea',NULL,15,39412,'Jerry Bradshow','','Craft','0px -251px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457697040/dxdaowolyyybojguojk7.jpg',1,NULL),(13,22,11,'Kien','the first flexible sound system','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457697576/ci2e5te5vsusdnmfofj6.jpg','<p>Hey everyone! You guys are going to love this: our creative director is showing the feature of cycling a sat between grouped and individual mode!</p><p>Audio is important in our lives. At kien we are determined to bring you a new breed of sound system that allows you to share audio with your friends anywhere and in any imaginable way you want: Dolby® surround sound, Hi-Fi stereo, multiroom, all made portable. Kien covers it all. Set your speakers up wherever you want: in your house or even outside. Start enjoying audio the way you want it.<br></p><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457698029/cxqzscmnsnoosfve5zip.gif\" data-image=\"\"></figure><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457698294/euugyqw46zii5okdsk8v.gif\" data-image=\"\"></figure><p><br></p>','Beta project',NULL,24,84083,'Florent Gautin','','Music','0px -367px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457697576/wfc9mihrvnoi185nlvrh.jpg',1,NULL),(15,23,16,'Motion AI','Easily create Artificial Intelligence to do almost anything !','Chicago','','IL','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458734111/nz8a8ux6loqppejc2j8k.jpg','<p>Build, train and deploy AI robots to do almost anything imaginable - from taking food orders and accepting payments, to running customer service chats and diagnosing patients.</p>\n\n<p>We\'re a passionate team of technologists who believe the dawn of the AI-driven economy is just around the corner.</p>\n\n<p>Our team is working hard to realize a vision of just-add-water Artificial Intelligence that will boost consumer satisfaction while simultaneously reducing costs for companies.</p>\n\n\n\n<p>Motion AI is based in the greater Chicago area.</p>\n\n<p>Check our website on&nbsp;<a href=\"http://motion.ai/\" target=\"_blank\">motion.ai</a></p>\n\n<p><br></p>','Beta project',NULL,286,24827,'David Nelson','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457698897/zajydt7jefttbxjrran5.jpg','Technology','0px -1px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458734111/ffbx5xsvo1olbujydopu.jpg',1,NULL),(16,24,1,'Asterisk Chair','Veneer Bar Stool','Finland','','MN','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457703851/bprq0jjf48ivxpufobsr.jpg','<p>The design was conceived through the gesture of a s-curve to use the strength of the curvature in veneer. Three legs meet on a common plane where all weight is placed and distributed through each of the three legs. For production purposes and flat packing, two of the legs are identical and can be stacked on top of each other when disassembled. The third leg provides the stability but holds a larger curve for structural reasons. Thicknesses of the legs were determined by its contribution of structural load. The rod was also included to serve as both a foot rest as well as a component to keep the legs from splaying if too much weight was to be placed on the stool. All six pig-nosed bolts are counter-sunk into the stool.</p><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457703900/pj2g18axglh7jafaxyl4.jpg\" data-image=\"\"></figure><figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457703970/fz8glmknu1h9zxk4j9zl.jpg\" data-image=\"\"></figure>','Idea',NULL,29,90925,'Rena Yang','','Art','0px 0px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457703851/ck0wvxfbqe6qdrgwfvbl.jpg',1,NULL),(17,42,6,'food','','Paris',NULL,'France','','','Idea',NULL,10,93642,'Clotilde Moreau','','Food','','','',1,NULL),(21,7,16,'Spritz','Save time, increase focus and have fun.','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457969236/k4fstru1o2chdkla4jf3.jpg','<h1></h1>\n\n<figure><a href=\"https://www.netlify.com/docs/ssl\" target=\"_blank\"><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457969624/z5tvelcefk6hphf5mkhs.png\" data-image=\"\" alt=\"Première photo\" title=\"Première photo\"></a></figure>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h1></h1>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h1>The Science&nbsp;</h1>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>Spritz worked for nearly 3 years in “Stealth Mode” to perfect our reading methodology before we introduced our technology to the world. We learned a lot in that time and developed our findings into the core technologies that you see here today. As an introduction to how and why Spritz works let’s start off with a few basics about reading.<br></p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h1>Reading Basics</h1>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>Traditional reading involves publishing text in lines and moving your eyes sequentially from word to word. For each word, the eye seeks a certain point within the word, which we call the “Optimal Recognition Point” or ORP. After your eyes find the ORP, your brain starts to process the meaning of the word that you’re viewing. With each new word, your eyes move, called a “saccade”, and then your eyes seek out the ORP for that word. Once the ORP is found, processing the word for meaning and context occurs and your eyes move to the next word. When your eyes encounter punctuation within and between sentences, your brain is prompted to assemble all of the words that you have read and processes them into a coherent thought.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/2WpGR_i8ckU\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h1>Why Spritz is Different</h1>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>There are lots of other reading techniques out there such as skimming (not reading every word), avoiding sub-vocalization (talking to yourself while reading) and enlarging the peripheral span (reading an entire page at a time by mental “snapshot”) that attempt to increase reading speeds. While these methods can be effective, achieving significant improvement requires intensive, continuous training and dedication. By contrast, spritzing can be learned in less than 5 minutes and, if you don’t spritz for a month, no practice is needed to return quickly to your previous speed or skill-level.In addition, none of these methods mentioned above help you unless you’ve got a lot of physical space for your content. From the fonts that we use to the algorithms that process content, Spritz is designed from the ground up to empower effective reading on a small display area. There is a lot more to Spritz than just reading fast!</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457969584/ixaqfm9wjooln514mile.gif\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h1>Spritz Technology</h1>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>Spritzing presents reading content one word at a time with the ORP positioned inside of our custom \"redicle\". &nbsp;Within the redicle are special prompts that keep your eyes focused on the ORP, allowing you to read without the need to move your eyes. With this approach, reading is more efficient because spritzing decreases the time spent searching for each word’s ORP. &nbsp;The following video compares traditional reading to Spritz and is a real eye-opener when it comes to the efficiencies that are gained by placing words exactly where your brain wants them to be located.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>asdsad</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>adasdasd</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>asdasd</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p><br></p>','Live project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1461424146/ajui1i4ethqebrfpibcn.mp4',230,57415,'Maxence Mson','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458587075/ejrk6p8i4fxn8qqfg87l.jpg','Technology','0px -187px','ajui1i4ethqebrfpibcn','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457969237/ta5fmgmjfxqwljlsllon.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461437820/noxyb17pwpadgmdhjdkg.jpg'),(28,52,16,'Connexion','','Paris',NULL,'France','','','Live project',NULL,8,41058,'Charlotte Hamelin','','Technology','','','',1,NULL),(29,77,16,'Whire.me','','Paris',NULL,'France','','','Beta project',NULL,18,29239,'Hugo Côté','','Technology','','','',1,NULL),(31,85,16,'Super project','','Grenoble','','France','','','Idea',NULL,7,30098,'Julien Mery','','Technology','','','',1,NULL),(53,3,14,'Robotic Extrusion','A printing head led by KUKA R900 produced self-supporting structure(ABS)','Cambridge','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458579845/dcxxo738epemfwb0mmcq.jpg','<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//player.vimeo.com/video/117134365\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div><p><br></p>\n\n<h1>ROBOTIC EXTRUSION</h1>\n\n<p><br>Research of Digital Craftsmanship & Autonomous Fabrication<br>&nbsp;<br>The project, Robotic 6-Axis 3D Printing, is a highly-integrated installation combining robotics, 3D printing technique and interactive interface. It aims to provide the designer a digital method to eliminate the line between \"Designing\" and \"Fabricating\". In this case, architects provides more than just drawings and construction notes, however, they are capable of fabricating their work quickly and precisely by themselves.<br>&nbsp;<br>Most of today\'s researches and applications of robotic fabrication are limited to replicating human labor and raising efficiency of manufacturing. However,&nbsp; in the project of Robotic 6-Axis 3D Printing, we developed a fabrication strategy learning and emulating the law of nature (referring to Chinese philosophy \"师法自然 \"). By studying the material and structure performance of 3D form in nature, we figured out a way to incorporate biomimetic fabrication strategy into 3D printing process. And by designing the special robotic-end effector (Tooling) and utilizing the great flexibility and accuracy of KUKA robotics, the biomimetic fabricating process has been fully realized.<br>&nbsp;<br>The whole process embodied the concept of \"Digital Crafsmanship\", which emphasis the personality of designer and allows them to closely intergrated \"Designing\" and \"Fabricating\".<br>........................................................................................................................................................................................................</p>\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/5c8b1722536831.5631453917ac1.jpg\"></p>\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/39743222536831.5631453192288.jpg\"></p>\n\n\n\n<p>Whole Printing Process / Freeze Frames of the Movie</p>\n\n\n\n\n\n<p><em></em></p>\n\n<p><em></em></p><em>\n\n\n\n<p>........................................................................................................................................................................................................<br>PHASE 01: BIOMIMETIC CONCEPT & SIMULATION<br>&nbsp;<br>3D printing technology has great potential in future fabrication field, however, it is unconvincing to address it with the name of future craftsmanship. This manufacturing process has limitations in spatial flexibility and fails to perform a fabrication structural strategy. It is because the current 3D printing technology mostly relies on the superimposition of thermoplastic ABS/PLA material along direction of gravity.<br>&nbsp;<br>Robotic 6-Axis 3D Printing project uses the same material (ABS) but has make a breakthrough in the way it prints. By mimicking the micro-structure of spider silk thread, a specific fabrication strategy has been added into this process. This change makes it possible to print simple self-supporting forms and is capable to show how the form grow from the ground. In this way, the material develops its full potential to expanded the materiality through the biomimetic printing progress.<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/4bb7c522536831.563145124af3f.jpg\"></p>\n\n\n\n<p>Structural Inspiration from Spider Thread</p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/59f29e22536831.56314516a11bc.jpg\"></p>\n\n\n\n<p>Reinforcement of Linear Structure of ABS Material</p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/6713c122536831.5631450ed6869.jpg\"></p>\n\n\n\n<p>Structure&nbsp;Simulation Before Fabrication (Software Simulation & Physical Model Simulation)</p>\n\n\n\n\n\n<p>........................................................................................................................................................................................................<br>PHASE 02: DESIGN OF THE PRINTING HEAD(ROBOTIC END-EFFECTOR)<br>&nbsp;<br>In 6-Aixs 3D Printing project, the idea of biomimetic structure is realized by a delicate robotic-end effector. The core component is a petaloid turn-plate, which has 3 movable printing head attached alongside and 1 fixed printing head in the center. When the whole system is powered by a servo and start functioning, the rotation of turn-plate leads to the oscillating motion of 3 movable printing head, which in turn produce the spindle-knot-like motion trail.<br>&nbsp;<br>The printing module is standardized 3D printing module based on thermo-plasticity of ABS material. The temperatures sensor and heater inside the module take precise control of the printing process. As a result, the 3D printing system, combined with the mechanical system, is capable of printing the biomimetic structure.<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/16b07b22536831.56314572339fc.jpg\"></p>\n\n\n\n<p>Functioning Tool Head (2 Printing Status)</p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/3e1eed22536831.5631452975b5d.jpg\"></p>\n\n\n\n<p>Axon Illustration of the Printing Head(Robotic End-effector)</p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/d938bd22536831.5631457c339c6.jpg\"></p>\n\n\n\n<p>Exploded Axon Illustration of the Printing Head (Robotic End-effector)</p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/e78dac22536831.563144e39a679.jpg\"></p>\n\n\n\n<p>Close-up of Explode illustration - Core components of the system</p>\n\n\n\n\n\n<p>........................................................................................................................................................................................................<br>PHASE 03: DESIGN OF EXTERNAL DIGITAL CONTROL SYSTEM&nbsp;<br>&nbsp;<br>The programming of the robotic-end effectors is based on Arduino. Each printing head has a heater inside which is uniquely programmed and can precisely maintain the temperature in appropriate range. Also there are tubes sending compressed air to the front of printing head to cool and finalize the material. Four material(ABS) deliver system driven by 4 individual servos works like normal 3D printing devices. Besides, one motor is responsible for the rotating motion of the central turn-plate. Both the speed of delivering and rotating can be changed via the switches on the center stack. In this case, the shape of the structure can be adjusted following the designer\'s idea.<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/f6b87022536831.5631456e6d3aa.JPG\"></p>\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/f9037622536831.5631456e5d9c4.jpg\"></p>\n\n\n\n<p>Components of External Digital Control System</p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/6ce45522536831.5631456fde1be.jpg\"></p>\n\n\n\n<p>Work-flow Diagram of the Circuit System</p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/278f3322536831.5631456e6623b.JPG\"></p>\n\n\n\n<p>Close-up view of the Circuit System</p>\n\n\n\n\n\n<p>........................................................................................................................................................................................................<br>FABRICATION PHOTOS (PROGRESS/PRODUCTION/EXHIBITION)<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n<p><em><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/1fe83b22536831.56314899358da.JPG\"><br></em></p></em>','Beta project',NULL,402,77941,'Henry Wei','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457648516/tgaugxgkwjzj0ik5bhcu.jpg','Science','0px -43.075px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458579845/l1pg7drtydg116axywbi.jpg',1,NULL),(54,97,16,'Crownstone','','Rotterdam',NULL,'Netherlands','','','Live project',NULL,9,19080,'Anne van Rossum','','Technology','','','',1,NULL),(55,101,15,'WoodRover','Luxury Wooden Bicycles','Kiev','','Kyiv city','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458586835/i85k7hlipk0wq373ptv2.jpg','','Live project',NULL,102,54246,'Valeriy Gorbatov','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAL2tuYOcdcOIKSNcwFOzY1ZAqyJqqDEZBw3ofkSNEU1','Sport','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458586833/qk6umrauzyglbeohqxe5.jpg',1,NULL),(56,126,16,'Build Focus','Train yourself to concentrate, beat distraction, and get more done.','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458647973/z5iv8etb5ngy6ripuin3.jpg','<p><a href=\"http://www.buildfocus.io\"><strong>Build Focus</strong></a> is a productivity tool that trains your mind, to wean you off checking Facebook every five minutes and onto focused concentration, so you can beat distraction and get things done.</p>\n\n<p>Inspired by addictive games like World of Warcraft and Farmville, it puts gamification to use for good in your own head, and creates a powerful instant feedback loop that drives you towards concentration and focus, and out of distraction.</p>\n\n\n\n\n\n<p>Quit automatically opening Twitter when the going gets tough, and stop losing time to the internet; teach your brain better habits, kill distraction, and reach your goals.</p>','Beta project',NULL,175,59887,'Tim Perry','https://lh6.googleusercontent.com/-tmYaon1pd1E/AAAAAAAAAAI/AAAAAAAAXtQ/13GqxkStsMM/photo.jpgsz=200','Technology','0px -302px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458647973/u0pi6u3ictilp3njrdgu.jpg',1,NULL),(57,133,16,'MySeer','A simple gadget that helps you decide whether or not to bring an umbrella on your way out the door.','New York','','NY','','<p>Despite </p>','Beta project',NULL,18,69437,'Jarek Lupinski','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458705999/t75lmmi4lg40xsclhnrd.jpg','Technology','','','',1,NULL),(59,139,3,'Shelter','The Shelter sunglasses are the fruit of an offbeat vision of the eyewear world','Annecy','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458838787/ahudgcyrlyaboomjokzi.jpg','<p><strong>Shelter Woodsunglasses made in Annecy - A Thorough french manufacturing</strong></p>\n\n<p>Rooted in time, the Shelter brand was created in July 2013 following the resounding success won on the crowdfunding platform KissKissBanBank. In 45 days, we&nbsp;raised more than 18000 euros&nbsp;and 150 pre-orders for the manufacturing of pairs of sunglasses to be delivered in two months.&nbsp;Challenge taken up !</p>\n\n<p>Shelter has been a curious endeavor from the beginning. From our&nbsp;wood&nbsp;<em>workshop, based in the city of Annecy, they manufactured their sleek and timeless first collection. Each frame is unisex and made with a multilayer wooden structure the maximize the linkage between robustness, flexibility, lightness and comfort.</em></p><p>An endeavor to create a product that encompasses the individuality and uniqueness that can only be found in natural surroundings. A desire to experiment with design, materials and aesthetics in the search for something that works. Free from passing trends, the brand’s focus remains that of its roots, innovation and creation. Long live creativity.</p><p>The Shelter sunglasses are the fruit of an offbeat vision of the eyewear world and are designed to arouse the curiosity of a community in search of authenticity and tradition.<br>Each frame is unique and has its own characteristic associated.</p>','Live project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1458917093/tf5br8h1fejjfo2zagha.mp4',297,61750,'Emeline Barat','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAK3ejroQCGdlCvsOo9FeLIwrEJkUsCipuYNahMREK5R','Design','50% 50%','tf5br8h1fejjfo2zagha','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458838788/rawnvuyxehimfxqap42q.jpg',1,NULL),(60,143,5,'hoop','Shoot a video and see what shoots back.','Tel Aviv Region','','Israel','','','Live project',NULL,1,61243,'Danielle Meyers','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAGtxDH1b9zB46ncDsD5HNe3qv97uqduVbUaluzNWUOG','Film & Video','','','',0,NULL),(61,145,11,'Cizoo','Cizoo app allows you to sing a message easily to your friends','Paris','','France','','','Live project',NULL,1,47092,'Sebastien Debry','','Music','50% 50%','','',1,NULL),(62,149,16,'Bisly.co','','Paris',NULL,'France','','','Live project',NULL,1,57690,'Jeremie Nacache','','Technology','','','',1,NULL),(63,150,16,'el needO','','Albi',NULL,'France','','','Beta project',NULL,1,69378,'El Needo','','Technology','','','',1,NULL),(66,9,4,'Single Ladies','','Conches-sur-Gondoire',NULL,'France','','','Drafted project',NULL,11,93085,'Olivier Hamelin','','Fashion','','','',1,NULL),(67,107,1,'aa','','Boulogne-Billancourt',NULL,'France','','','Drafted project',NULL,0,73439,'Anthony Haddad','','Art','','','',1,NULL),(68,159,16,'Hot','','Paris',NULL,'France','','','Idea',NULL,7,42900,'Alizée BRETON','','Technology','','','',1,NULL),(69,68,3,'Toolbox','','Paragould',NULL,'AR','','','Beta project',NULL,8,77051,'Jeanne Menfield','','Design','','','',1,NULL),(74,10,1,'dsw','','Xanten','','Germany','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1460990086/gdvoze5nhmtpxj6g6oyu.jpg','<p>wefcwerfwerfcewrcf</p>','Idea',NULL,2,82309,'Erwan Colins','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457689509/pxwhhrsrg8y3t9qnmutl.jpg','Art','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1460990086/ylkpmy0pcgtlvb5fgyfp.jpg',1,NULL),(93,165,3,'D-TWELVE Lamp','Explore the infinite ways of using the first modular, versatile and customizable handmade LED lamp','Rome','','Metropolitan City of Rome','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461313131/g4hsua4buorgtpni2fzk.jpg','<p>Plato Design is running a crowdfunding campaign ending May 16th 2016 to start D-TWELVE production. Please have a look <a href=\"http://kck.st/1qeVfnx\">here</a>.</p>','Live project',NULL,2,11308,'Plato Design','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461312900/stsqh5mukmthqx5ltmmo.jpg','Design','0px -12px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461313119/invmzhb4hgxlvmt8kno0.jpg',1,NULL),(110,7,1,'receiptr','','Paris','','France','','','Idea',NULL,2,14257,'Maxence Mson','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458587075/ejrk6p8i4fxn8qqfg87l.jpg','Art','','','',1,NULL),(111,12,1,'Test_Poster','','Évry','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461457250/eracssnkmff8hr2dbx5k.jpg','<p>srqfrf</p>\n\n<p>zqfezeqfzefsef</p>\n\n\n\n<p>zsqfqzefqzefzef</p>\n\n\n\n<p>fezqzef</p>\n\n\n\n<p>ezf</p>\n\n\n\n<p>zef</p>\n\n\n\n<p>esf</p>\n\n\n\n<p><br></p>\n\n\n\n<p>zefqzefqezfzqefezfzeqfzf</p>','Drafted project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1461457292/jxlpzinubhrqkaceut70.mp4',7,29433,'Sebastian Moresta','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691617/vefkdhglnraxr2owpfji.jpg','Art','0px 0px','jxlpzinubhrqkaceut70','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461457250/msruq60ekvkuy3xjp7e9.jpg',0